import React from 'react'
import DashboardButton from './DashboardButton'

function DashboardHeader(props){
    return (
        <div className="dashboard-header">
            <h3 className="h3-dashboard" >Dashboard</h3>
            <div className="btn-margin">
                <DashboardButton class="dashboard-btn-left" name="Add an expense" onclick={props.handleView(props.viewType.map(
                    item => {
                        if(item.visibility == true){
                            item.visibility = !item.visibility
                        }
                        if(item.dash == "dash-exp"){
                            item.visibility = item.visibility
                        }
                    }
                ))}/>
                <DashboardButton class="dashboard-btn-right" name="Settle up" />
            </div>
        </div>
    )
}

export default DashboardHeader
